import './App.css';

function App() {
  let kursy = ["Programowanie w C#", "Angular dla początkujących", "Kurs Django"];
  return (
    <div className="App">
      <h2>Liczba kursów: {kursy.length}</h2>
      <ol>
        {kursy.map((kurs, key) => <li key={key}>{kurs}</li>)}
      </ol>
    </div>
  );
}

export default App;
